// attach to your plane in the three.js editor (SCRIPT tab)
let video, texture;

function start() {
  // put your actual file here; prefer .webm or .mp4
  const url = 'frailejones_comp.webm';

  video = document.createElement('video');
  video.src = url;
  video.loop = true;
  video.muted = true;       // needed for autoplay
  video.playsInline = true; // iOS

  // try autoplay; fall back to user gesture
  video.play().catch(() => {
    console.log('tap/click to start video');
    const onUserGesture = () => {
      video.play().catch(console.warn);
      window.removeEventListener('pointerdown', onUserGesture);
    };
    window.addEventListener('pointerdown', onUserGesture);
  });

  texture = new THREE.VideoTexture(video);
  texture.colorSpace = THREE.SRGBColorSpace;
  texture.minFilter = THREE.LinearFilter;
  texture.magFilter = THREE.LinearFilter;
  texture.generateMipmaps = false;

  // apply to this mesh's material
  this.material.map = texture;
  this.material.needsUpdate = true;

  // (optional) match plane aspect to the video once metadata is known
  video.addEventListener('loadedmetadata', () => {
    const w = video.videoWidth || 16;
    const h = video.videoHeight || 9;
    const height = 1;                   // 1 unit tall
    const width  = height * (w / h);
    this.scale.set(width, height, 1);   // if your plane is 1x1 by default
  });
}

function dispose() {
  if (texture) texture.dispose();
  if (video) { video.pause(); video.src = ''; }
}
